In a saucepan combine peanut butter, cream cheese, chili sauce, and soy sauce;
        whisk in 3/4 cup of the hot pasta water. Stir over medium heat until heated through. If the mixture is too thick, stir in additional water.
        Stir in most of the green onions. Serve sauce over pasta with sweet potatoes and remaining green onion slices.
